import React, { Component } from "react";
import NavComplete from "../components/navcomplete";
import Data from "../data/allarticles.json";
import ArticleSpread from "../components/articlespread";

class AllArticles extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "1fr",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              height: 20,
              width: 20,
              backgroundColor: "black",
              display: "flex",
              alignItems: "center",
              gridArea: "desc",
            }}
          >
            <div
              style={{
                fontSize: 30,
                fontFamily: "Unna",
                fontStyle: "italic",
                fontWeight: "bold",
                position: "relative",
                left: "150%",
              }}
            >
              latest
            </div>
          </div>
          <div
            style={{
              display: "grid",
              gridTemplateColumns: "repeat(auto-fit, minmax(100px, 400px))",
              gridTemplateRows: "repeat(auto-fit, 400px)",
              justifyContent: "center",
              gridGap: 50,
              marginTop: 100,
            }}
          >
            <React.Fragment>
              {Data.content.map((counter) => (
                <div>
                  <ArticleSpread
                    key={counter.id}
                    title={counter.title}
                    content={counter.summary}
                    link={counter.link}
                  />
                </div>
              ))}
            </React.Fragment>
          </div>
        </div>
      </div>
    );
  }
}

export default AllArticles;
